import React from "react";
import { useHistory } from "react-router-dom";

const Loading = () => {
  let history = useHistory();

  const handleClick = () => {
    history.push("/login");
  };
  return (
    <div className="loading">
      <button type="button" onClick={handleClick}>
        Go home
      </button>
    </div>
  );
};

export default Loading;
